import React from "react";
import { Icon } from '@iconify/react';
import validator from 'validator';
import axios, * as others from 'axios';




 
function Papildymas() {
    let status = 0;
    function query(values){
        axios.post("http://localhost:3001/getCard", {
            number: values.number,
            cvv: values.cvv,
            date: values.date,
          },{
            headers: {
                'Access-Control-Allow-Origin': '*',
                'Content-Type': 'application/json',
              }
          })
          .then((response) => {
            status = response.status;
            if(response.status == 200){
                    console.log("OK");
                    return 0;
            }else if(response.status == 404){
                console.log("Ne OK");
                return 1;
            }else{
                console.log("Ne OK");
                return 2;
            }
                
          }).catch((e) => {console.log(JSON.stringify(e.response.status));
            
    
        });
    }
    const submitHandle = (e)=>{
        e.preventDefault();
        query(values);
        console.log(status);
    };

    const [values, setValues] = React.useState({});
    const handleInput = (event)=>{
        setValues(prev=>({...prev, [event.target.name]:[event.target.value]}));
        console.log(errors);
        // console.log(Object.keys(values).length);
    };
    const [errors, setErrors] = React.useState({});
    const validateNumber = (event) =>{
        if(!event.target.value){
            setErrors({[event.target.name]:"Įveskite korteles numerį"});
        }
        else{
                setErrors(!validator.isCreditCard(event.target.value)?{[event.target.name]:"Įveskite taisyklingą kortelės numerį"}:""); 
        }
    };
    const validateCvv = (event) => {
        if(!event.target.value){
            setErrors({[event.target.name]:"Įveskite CVV"});
        }
        else{
            setErrors(!validator.isByteLength(event.target.value, {
                min: 3,
                max: 3
            })?{[event.target.name]:"Cvv turi buti 3-simbolių ilgio"}:""); 
        }
    };
    const validateDate = (event) =>{
        if(!event.target.value){
            setErrors({[event.target.name]:"Įveskite datą"});
        }
        else{
            setErrors({[event.target.name]:""});

        }
    }


    return (
    <section className="main">
    <form action="#" className='main-content' onSubmit={submitHandle}>
        <a href="/" className="atgal"><Icon icon="ep:back" className="atgal-icon"/>atgal</a>
        <section className="form-item">
         <p>kortelės numeris: </p>
         <input type="text" name='number' onChange={e=>{handleInput(e); validateNumber(e)}} required placeholder='Įveskite kortelės numerį' className='form-input' id='main-card-number' value={values.number||""} maxLength = "16"/>
         <p className="error">{errors.number||""}</p>
        </section>
        <section className="form-item1">
            <section className="form-item1-element">
                <p>cvv: </p>
                <input type="text" name='cvv' onChange={e=>{handleInput(e); validateCvv(e)}}  required placeholder='cvv' className='form-input' id='main-card-cvv' value={values.cvv||""} maxLength = "3"/>
                <p className="error">{errors.cvv||""}</p>
            </section>
            <section className="form-item1-element">
         <p>data: </p>
         <input type="text" name='date' onChange={e=>{handleInput(e); validateDate(e)}} required placeholder='data' className='form-input' id='main-card-date' value = {values.date} maxLength={5}/>
         <p className="error">{errors.date||""}</p>
        </section>
     </section>
     <section className="form-item suma">
        <p>suma: </p>
        <input type="text" name='sum' required placeholder='0' className='form-input' id='main-card-number'/>
       </section>
        <section className="form-item">
           <button type="submit" className='papil-button' ><Icon icon="uil:money-insert" className='main-icon'/>Papildyti</button>
        </section>  
      </form>
    </section>);
}
 
export default Papildymas;
